yy.Apply = class Apply {
	constructor(params) {
		Object.assign(this, params);
	}

	toString() {
		let s = `${this.applymode} APPLY (${this.select.toString()})`;

		if (this.as) {
			s += ` AS ${this.as}`;
		}

		return s;
	}
};
